import { useEffect } from 'react';
import { Button, Card, TextField, Typography } from "@material-ui/core";
import { Logo } from "src/components/Logo";
import useStyles from "./style";

export const Signup = () => {
  const styles = useStyles();

  useEffect(() => {
    document.title = "新規アカウント登録";
  });

  return (
    <Card className={styles.root} variant="outlined">
      {/* ロゴコンポーネント */}
      <div className={`${styles.logo} ${styles.margin}`}>
        <Logo />
      </div>

      {/* タイトルコンポーネント */}
      <Typography className={styles.margin} component="h1" variant="h5">
        新規アカウント登録
      </Typography>

      {/* 名前フィールド */}
      <label className={`${styles.label} ${styles.margin}`}>
        <Typography>名前</Typography>
        <TextField required size="small" fullWidth variant="outlined" />
      </label>

      {/* メールアドレスフィールド */}
      <label className={`${styles.label} ${styles.margin}`}>
        <Typography>メールアドレス</Typography>
        <TextField
          type="email"
          required
          size="small"
          fullWidth
          variant="outlined"
        />
      </label>

      {/* パスワードフィールド */}
      <label className={`${styles.label} ${styles.margin}`}>
        <Typography>パスワード</Typography>
        <TextField
          type="password"
          required
          size="small"
          fullWidth
          variant="outlined"
        />
      </label>

      {/* Submitボタン */}
      <div className={styles.margin}>
        <Button variant="contained" color="primary">
          新規作成
        </Button>
      </div>

      <div>
        <Button href="Login" color="primary">
          ログインはこちら
        </Button>
      </div>
    </Card>
  );
};
